import React from "react";
import { Link } from "react-router-dom";
import Card from "react-bootstrap/Card";
// import Button from "react-bootstrap/Button";

export default function Category(props) {
  const { category } = props;
  console.log("first props in Product.js");
  console.log(category._id);

  return (
    <Card className="card">
      <img className="medium" src={category.image} alt={category.name} />

      <Card.Body className="contentOurWork">
        <Card.Text>{category.name}</Card.Text>
        <Link to={`/search/category/${category.name}`}>View Category</Link>
      </Card.Body>
    </Card>
  );
}
